    ?archduchess_margaret_of_austria <http://dbpedia.org/resource/Archduchess_Margaret_of_Austria_(born_1925)>.
    ?child_of_native <http://dbpedia.org/resource/Budapest>.
    ?child_of_native <http://dbpedia.org/ontology/birthPlace> <http://dbpedia.org/resource/Budapest>.
    ?final_child <http://dbpedia.org/property/father> ?child_of_native.
}
