The SPARQL query to achieve this can be constructed as follows:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbo: <http://dbpedia.org/ontology/>

// Step 1: Find the birth date of Pavlo Khudzik
SELECT ?birthDate WHERE {
    <http://dbpedia.org/resource/Pavlo_Khudzik> dbo:birthDate ?birthDate
}

// Step 2: Find individuals born on the same date as Pavlo Khudzik
PREFIX : <http://dbpedia.org/ontology/>

SELECT ?person ?band WHERE {
    ?person dbo:birthDate ?birthDate .
    ?birthDate = ?birthDateFromPavlo .
    OPTIONAL { ?person a dbo:Musician . }
    OPTIONAL { ?person rdfs:label ?bandLabel . }
    FILTER (?bandLabel LIKE '%Amba Shepherd%' )  // Filter for Amba Shepherd band
}

// Step 3: Combine results to ensure the person is associated with another band
```

This query first finds the birth date of Pavlo Khudzik. Then it selects individuals born on that date and checks if they are musicians (associated with a band) and specifically if they are associated with Amba Shepherd.

