PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia: <http://dbpedia.org/ontology/>

// Step 1: Identify the commander in the Battle of Panium
SELECT ?commander WHERE {
    <http://dbpedia.org/resource/Battle_of_Panium> <dbpedia:commander> ?commander .
}

// Step 2: Find the child of this commander
PREFIX : <http://dbpedia.org/ontology/>
SELECT ?child WHERE {
    ?commander <rdf:type> :Person.
    ?commander <dbpedia:hasChild> ?child .
}

// Step 3: Determine the parent of this child
PREFIX : <http://dbpedia.org/ontology/>
SELECT ?parent WHERE {
    ?child <rdf:type> :Person.
    ?child <dbpedia:hasParent> ?parent .
}

// Step 4: Identify the successor of Antiochus (son of Antiochus III the Great)
SELECT ?successor WHERE {
    <http://dbpedia.org/resource/Antiochus_(son_of_Antiochus_III_the_Great)> <rdf:type> :Person.
    <http://dbpedia.org/resource/Antiochus_(son_of_Antiochus_III_the_Great)> <dbpedia:successor> ?successor .
}

// Step 5: Find the child of this successor who is a royalty
PREFIX : <http://dbpedia.org/ontology/>
SELECT ?royalty_child WHERE {
    ?successor <rdf:type> :Person.
    ?successor <dbpedia:hasChild> ?royalty_child .
    ?royalty_child <dbpedia:isRoyalty> true .
}

// Step 6: Determine the spouse of this child
PREFIX : <http://dbpedia.org/ontology/>
SELECT ?spouse WHERE {
    ?royalty_child <rdf:type> :Person.
    ?royalty_child <dbpedia:hasSpouse> ?spouse .
}
